script: |
  super -f text -I q1973.spq | sort > q1973.out

inputs:
  - name: q1973.spq
    data: |
      SELECT ALL - 37 * + - 34 - - COUNT ( * ) FROM tab0 (FORMAT parquet) cor0 WHERE ( + + col2 ) - + + 65 - 9 NOT BETWEEN col2 * + - col1 + - col2 - col0 + - col2 AND + col1;
  - name: tab0

outputs:
  - name: q1973.out
    data: |
      1259
